import React, { useState } from "react";
import styles from "./SearchResults.module.css";

const tracks = [
  {
    songName: "Song1",
    songArtist: "Artist1",
    songAlbum: "Album1",
    songID: "id1",
  },
  {
    songName: "Song2",
    songArtist: "Artist2",
    songAlbum: "Album2",
    songID: "id2",
  },
  {
    songName: "Song3",
    songArtist: "Artist3",
    songAlbum: "Album3",
    songID: "id3",
  },
];

const Song = ({ songName, songArtist, songAlbum, songID }) => (
  <div>
    <li key={songID}>
      <h2>{songName}</h2>
      <h3>
        {songArtist},{songAlbum}
      </h3>
    </li>
    <button>Add</button>
  </div>
);

export default function SearchResults() {
  return (
    <div
      className="SearchResults-header"
      style={{ border: "1px solid black", marginRight: "2em" }}
    >
      <h1>Results</h1>
      <div style={{ border: "1px solid black", marginRight: "2em" }}>
        <ul>{songs.map(Song)}</ul>
      </div>
    </div>
  );
}
